import "./HomeComp.css";
import { Image } from "react-bootstrap";

function HomeComp() {
  return (
    <div className="rectangle">
      <img
        src="https://cdn.suwalls.com/wallpapers/beaches/palawan-island-resort-philippines-28615-1920x1080.jpg"
        alt="hotel-beach"
      ></img>
    </div>
  );
}

export default HomeComp;
